import React from 'react';
import { Typography } from '@material-ui/core';

const Dashboard = () => {
    return (
        <>
            <Typography>Hello there,
            Check on the Menu.
            Secret mode if you search.</Typography>
        </>
    )

}

export default Dashboard;
